sample: '["\"Sp\u00f8rreunders\u00f8kelse \u2013 FUNCAP\\nME-foreningen samarbeider
  med professor Kristian Sommerfelt for \u00e5 utvikle et skjema som kan m\u00e5le
  funksjonsevne hos ME-syke. Dere kan hjelpe oss \u00e5 teste skjemaet, og sammenligne
  det med to andre skjemaer som er mye i bruk. B\u00e5de ME-syke og friske kan svare\\nSe
  videoen, eller les mer om unders\u00f8kelsen p\u00e5 v\u00e5r nettside.\\nSkoleprosjektet\\nPodcast\\nME-foreningens
  podcast \u00abLeve med ME\u00bb ligger b\u00e5de p\u00e5 Acast, Spotify og andre
  steder der du lytter til podcast. Det er forel\u00f8pig produsert seks episoder,
  og vi planlegger flere.\\nPodcasten tar opp ulike temaer om det \u00e5 leve med
  ME, som informasjon om sykdommen, mestring, hvordan det er \u00e5 ha ME, ME og skole
  og pleietilbud for de sykeste. Husk \u00e5 abbonere!\\nKlikk p\u00e5 knappen under
  for \u00e5 komme til episodene.\\nMeld deg inn!\\nME-foreningen arbeider for bedre
  forhold for alle ME-syke.\\nDa viser du at du st\u00f8tter foreningens arbeid \u2013
  vi st\u00e5r sterkere sammen.\\nKoronavirus\\n\u00abHelsemyndighetene har kommet
  med en rekke r\u00e5d for \u00e5 unng\u00e5 smitte av covid-19. Det er spesielt
  viktig at personer med kronisk sykdom f\u00f8lger disse r\u00e5dene. Pasienter med
  CFS/ME m\u00e5 derfor f\u00f8lge ekstra n\u00f8ye anbefalingene og holde seg hjemme,
  begrense kontakter og p\u00e5 alle mulige m\u00e5ter unng\u00e5 \u00e5 utsette seg
  for smitte. For de som blir smittet, vil behandlingen sannsynligvis v\u00e6re lik
  som for andre pasientgrupper.\u00bb\\nLikepersonsarbeid\\nLikepersonsarbeid er blitt
  definert som \u201den samhandling mellom personer som opplever \u00e5 v\u00e6re
  i samme b\u00e5t, det vil si i samme livssituasjon, og hvor selve samhandlingen
  har som m\u00e5l \u00e5 v\u00e6re en hjelp, st\u00f8tte eller veiledning partene
  i mellom\u201d.\"", "\"Hanne Merete Falck er samboer med odelsgutten Tor Str\u00f8msnes
  (57). De har h\u00f8ns, ender, hunder og marsvin p\u00e5 g\u00e5rden p\u00e5 \u00c5rnes
  i Viken, og svigermor har katter. Planen er \u00e5 anskaffe flere dyr. Hanne vil
  gjerne bruke g\u00e5rden som en base for \u00e5 hjelpe andre, med grunnlag i sine
  egne erfaringer.\\nInnarbeidet d\u00e5rlige vaner\\n\u2013 Jeg var ikke blant de
  f\u00f8rste til \u00e5 smake alkohol. N\u00e5r venninnene mine stjal sprit hjemme,
  interesserte det meg ikke. F\u00f8rst i 19-\u00e5rs alderen opplevde jeg hvor fri
  og glad jeg ble av litt innabords, sier Hanne.\\nHun var eventyrlysten og flyttet
  til Hellas da hun var 20. Der ble hun i tre \u00e5r. F\u00f8rst jobbet hun med bilutleie,
  deretter i bar. Det var b\u00e5de akseptert og vanlig \u00e5 drikke litt hele dagen,
  ikke mye, men nok til at nye alkoholvaner ble innarbeidet. Disse tok Hanne med seg
  hjem, og med jobb i salgsbransjen, var det stadig eventer der alkoholen fl\u00f8t.\\n\u2013
  Jeg var aldri blant dem som ble fullest p\u00e5 fest, men i mitt hode ga rusen selvsikkerhet
  og trygghet, sier Hanne.\\n\u2013 Jeg bodde alene, var husredd og innbilte meg at
  jeg ikke fikk sove uten \u00e5 drikke litt f\u00f8rst. I helgene ble det mer. Alkoholen
  ble min alt-mulig-medisin, selvf\u00f8lelsen steg og sjenansen forsvant. Det var
  jo s\u00e5nn jeg egentlig ville v\u00e6re. Trodde jeg.\\nDrakk ikke i svangerskapene\\n\u2013
  S\u00e5 m\u00f8tte jeg han som ble faren til barna mine, forteller Hanne.\\nUnder
  svangerskapene og i ammeperiodene r\u00f8rte hun ikke alkohol. Da den yngste datteren
  var 14 m\u00e5neder tok forholdet med barnefaren slutt. Hanne ble alenemor. Med
  fri annenhver helg. Hun drakk litt etter at barna hadde lagt seg, og de helgene
  hun ikke hadde jentene ble det fri flyt. Plutselig var det helt greit \u00e5 reparere
  p\u00e5 s\u00f8ndager.\\n\u2013 I 2001 flyttet barna og jeg fra Oslo til Hadeland.
  Jeg begynte av ulike grunner \u00e5 utvikle angst. Dessverre begynte jeg ogs\u00e5
  \u00e5 like r\u00f8dvin. Da var det gjort, forteller Hanne.\\nEtter et brudd \u00f8kte
  alkoholforbruket. Det ble av forskjellige \u00e5rsaker vanskelig \u00e5 bo for seg
  selv, og Hanne og barna fikk bo i kollektiv hos en venninne. Drikkingen fortsatte,
  selv om venninnen pr\u00f8vde \u00e5 bremse henne. Den eldste datteren var mest
  med kj\u00e6resten sin og Hanne hadde et anstrengt forhold til den yngste, som bodde
  midt oppi det.\\nSelv ikke det \u00e5 ha ansvar for jenter p\u00e5 16 og 13 \u00e5r
  fikk Hanne til \u00e5 slutte \u00e5 drikke. Hun pr\u00f8vde seg p\u00e5 utdannelse,
  som hun ikke fullf\u00f8rte. Livet besto for det meste i \u00e5 vente p\u00e5 kvelden,
  hun ga seg selv lov til \u00e5 drikke etter klokka 19:00.\\nTraff dr\u00f8mmemannen\\nDa
  Hanne fikk kontakt med Tor p\u00e5 nettet, skj\u00f8nte hun at han var verdens flotteste
  mann. De ble enige om \u00e5 v\u00e6re \u00e6rlige med hverandre, og Hanne fortalte
  at hun drakk, men ikke hvor mye. Paret flyttet sammen i april 2012, og Hanne tok
  med seg de d\u00e5rlige vanene. N\u00e5 skjulte hun vinkartongene og drakk i smug.\\nTor
  er mass\u00f8r og drev klinikk, samtidig som han hjalp Hanne, som bygde opp en restaurant
  p\u00e5 Hadeland i 2014. Det ble en hektisk tid med mye jobbing, og alkohol ble
  en del av hverdagen, ogs\u00e5 p\u00e5 jobb.\\n\u2013 Jeg gikk over til \u00e5 ha
  r\u00f8dvinen i en Starbucks kaffekopp med lokk, og den hadde jeg med meg overalt.
  Men selvsagt merket Tor, barna og omgivelsene at jeg drakk allikevel. Etter snaue
  to \u00e5r ble det konkurs, hussalg og vin fra morgen til kveld.\\nKlarte ikke \u00e5
  v\u00e6re edru\\n\u2013 Da vi s\u00e5 flyttet hit til g\u00e5rden, f\u00f8lte jeg
  meg alene n\u00e5r Tor var borte p\u00e5 jobb. Jeg hadde ikke penger, og m\u00e5tte
  g\u00e5 den tunge veien til sosialkontoret, der jeg \u00e6rlig fortalte hvordan
  det var fatt. Jeg ble sluset videre til det offentlige, og fikk en engel av en ruskonsulent
  som hentet meg en dag i uken. Hun s\u00f8rget for at jeg kom til m\u00f8ter p\u00e5
  ARA (poliklinikk, spesialisert p\u00e5 rusavhengighet, journ. anm.), til legen og
  fikk gjort andre \u00e6rend, forteller Hanne.\\n\u2013 Jeg ville ikke avruses med
  medikamenter og jeg ville ikke p\u00e5 institusjon, selv om jeg f\u00f8lte at alt
  raknet. Jeg tenkte at dette var noe jeg kunne ordne p\u00e5 egenh\u00e5nd, sier
  Hanne.\\n\u2013 F\u00f8rerkortet mitt ble rutinemessig inndratt. Det var ikke noe
  problem, jeg hadde uansett ikke kj\u00f8rt bil p\u00e5 flere \u00e5r. Formen var
  elendig, og da jeg kastet opp r\u00f8dvin om morgenen, forklarte legen at jeg hadde
  d\u00e5rlige leververdier og betennelse i magesekken. F\u00f8rst da skj\u00f8nte
  jeg p\u00e5 alvor at det m\u00e5tte en endring til.\\nLikevel satt Hanne p\u00e5
  verandaen, eller perrongen, som de kaller den, og drakk hver dag. Hun drakk til
  04-tiden, f\u00f8r hun kom seg i seng. Hodet var s\u00e5 fylt av skam og skyld at
  hun ikke hadde en eneste klar tanke. S\u00e5 bestemte hun seg for \u00e5 snu d\u00f8gnrytmen.\\nVendepunktet\\nNeste
  gang Hanne satt p\u00e5 perrongen var f\u00f8r frokost. Edru. Hun h\u00f8rte fuglesang
  for f\u00f8rste gang p\u00e5 det hun kunne huske. Hun begynte virkelig \u00e5 snakke
  med og lytte til Tor, som blant annet er coach. De gode samtalene, pluss foredrag
  og podcaster hun h\u00f8rte p\u00e5 nettet gjorde at Hanne forsto det m\u00e5tte
  finnes en n\u00f8kkel til \u00e5 komme ut av rusmisbruket. Den n\u00f8kkelen ville
  hun finne.\\nKunne det v\u00e6re s\u00e5nn at den tryggheten hun s\u00f8kte, ikke
  fantes i alkoholen? Hanne begynte \u00e5 h\u00f8re p\u00e5 Julie Winges morgensendinger
  hver dag. Hun fulgte Facebookgruppen hennes et halvt \u00e5r. Det nettbaserte programmet
  \u00abTilbake Til Livet\u00bb hjalp Hanne med \u00e5 f\u00e5 en daglig rutine.\\n\u2013
  Jeg gledet meg hver dag til \u00e5 h\u00f8re p\u00e5 morgensendingene. Julie viste
  et ekte engasjement, med kunnskap og interesse for gruppen sin, dette hjalp meg
  mye i prosessen. Og da Julie skulle spille inn en podcast, der hun inviterte b\u00e5de
  avhengige og p\u00e5r\u00f8rende til \u00e5 med, klarte Tor \u00e5 overtale meg.
  Vi dro, og det var heldigvis lov \u00e5 drikke der. Min yngste datter var med, og
  det ble vendepunktet mitt.\\nRusklinikk p\u00e5 nett\\n- Julie Winge (50) er en
  norsk skuespiller, forfatter og rusbehandler. Hun har gitt ut boken \u00abFyllik\u00bb.\\n-
  Hanne har deltatt i Julie Winges program \u00abTilbake Til Livet\u00bb for alkohol
  og rusavhengighet p\u00e5 nett.\\n- Programmet er b\u00e5de lavterskel- og gruppem\u00f8ter
  p\u00e5 nett (ZOOM), der folk g\u00e5r i en reell behandling med et program til
  tilfriskning.\\n- Hanne er \u00e9n av 400 som hittil har f\u00e5tt den hjelpen.
  N\u00e5 er omtrent 300 personer i gang med programmet, og g\u00e5r mot edru, stabile
  liv.\\n- www.juliewinge.no/hjemmeside www.facebook.com/tilbaketilivet.no\\nHanne
  blir tykk i stemmen n\u00e5r hun forteller videre.\\n\u2013 Mamma, kan jeg stille
  et sp\u00f8rsm\u00e5l til Julie? Spurte datteren.\\n\u2013 Ja, selvsagt svarte Hanne.\\nDatteren
  stilte sitt sp\u00f8rsm\u00e5l. Julie Winge forsto ikke helt sp\u00f8rsm\u00e5let,
  som dreide seg om hva man kunne si til en som var aktiv rusavhengig, og hun spurte
  hvem det gjaldt.\\n\u2013 Det gjelder meg! Svarte jeg, og da skjedde det noe med
  meg. Jeg knakk fullstendig sammen i bilen hjem. Der gikk jenta mi og slet, fordi
  jeg drakk, og hun turte ikke en gang \u00e5 snakke med meg om det.\\nDette var en
  onsdag. Hanne fortsatte \u00e5 sitte ute p\u00e5 perrongen og drikke torsdag, fredag,
  l\u00f8rdag og s\u00f8ndag. Da hun hadde fylt opp siste kopp s\u00f8ndagskvelden,
  tok hun den med inn. Hun drakk den aldri.\\nForholdet til barna er aller viktigst\\nHanne
  h\u00f8rte som vanlig morgensendingen med Julie mandag. Kanskje hun skulle pr\u00f8ve
  \u00e5 spise frokost uten \u00e5 drikke f\u00f8rst? Deretter tok Hanne time for
  time, noe hun hadde l\u00e6rt i Julie Winges sendinger. Hun skulle ikke drikke denne
  timen, men kanskje neste. Plutselig var klokka 21, og da gikk det sport i ikke \u00e5
  drikke f\u00f8r hun la seg.\\n\u2013 Jeg visste at det kunne v\u00e6re farlig \u00e5
  br\u00e5slutte, og ba Tor passe ekstra godt p\u00e5 meg. Og sakte men sikkert fant
  jeg den tryggheten jeg s\u00f8kte. Det var ikke enkelt, men heller ikke umulig.
  Jeg inns\u00e5 at for meg var det alt eller ingenting, og etter hvert som timene
  ble til dager og til uker og m\u00e5neder, skj\u00f8nte jeg at jeg har det mye bedre
  uten alkohol, sier Hanne.\\n\u2013 For en eufori, for en glede! Jeg seilte p\u00e5
  de rosa skyene jeg hadde h\u00f8rt Julie snakke om. Hanne jubler mens hun forteller.\\n\u2013
  Tor blir r\u00f8rt n\u00e5r vi snakker om dette. Han sier at han ikke bare har f\u00e5tt
  tilbake kj\u00e6resten sin, han har f\u00e5tt s\u00e5 mye mer. Legen er forn\u00f8yd,
  alle pr\u00f8ver er fine.\\nHanne har f\u00e5tt tilbake lappen, og bobler av energi.
  Hun er allerede i dialog med kommunen for \u00e5 bli en Inn p\u00e5 tunet-g\u00e5rd,
  som er g\u00e5rder som yter velferdstjenester for eksempel innen arbeidstrening
