  "\"F\u00c5R TYN: Konsernsjefen i VW, en av de fem deleierne av Ionity-nettverket
  av lynladere, kritiserer selskapet for sviktende kundeservice.Foto: IONITY\\nIonity
  f\u00e5r pepper av Herbert Diess:\\nVW-sjefen raser mot sin egen lade-operat\u00f8r\\nI
  et innlegg p\u00e5 LinkedIn kommer VW-sjefen Herbert Diess med en utbl\u00e5sning
  mot serviceniv\u00e5et hos ladeoperat\u00f8ren Ionity etter at han var p\u00e5 biltur
  i Italia.\\nEuropeisk nettverk av hurtiglade-stasjoner med ladeeffekt opp til 350
  kW fra stolpene\\nF\u00f8rste stasjon \u00e5pnet i april 2018\\nSamarbeidsforetak
  (joint venture), eid i fellesskap av VW-konsernets tre selskaper Volkswagen, Audi
  og Porsche, BMW, Ford, Mercedes-Benz og Hyundai/Kia\\nHar flest stasjoner i Tyskland,
  fulgt av Frankrike, Sverige og Norge. Utrullingen i Europa fortsetter p\u00e5 fjerde
  \u00e5ret.\\n\u00abFor f\u00e5 ladepunkter i Brenner-passet! Bare 4 - og selvf\u00f8lgelig
  stopper alle ved kj\u00f8pesenteret: Opptatt. S\u00e5 jeg fortsatte til Trento.
  Selv etter kritikken i fjor: ingen toalett, ingen kaffe, \u00e9n ladestolpe ute
  av drift/defekt, trist aff\u00e6re. Det er alt annet enn en f\u00f8rsteklasses ladeopplevelse,
  IONITY!\u00bb\\nDet er ikke f\u00f8rste gang en VW-sjef kritiserer ladenettverket.\\nDet
  tyske bransjenettstedet Automobilwoche kan i etterkant fortelle at Ionity reagerte
  raskt etter denne tiraden.\\n\u00abDen defekte laderen ble reparert i g\u00e5r\u00bb,
  skrev operativ leder (COO), i Ionity, Marcus Groll, ogs\u00e5 p\u00e5 LinkedIn,
  bare noen timer etter at Diess hadde postet.\\nFor\u00f8vrig fikk Diess tross alt
  ladet i Trento - \u00e9n av de resterende ladestolpene var ledig.\\nP\u00e5 de to
  andre sto det en Porsche Taycan og en Audi e-tron. Full pott for VW-konsernet alts\u00e5.\\nKlager
  p\u00e5 takmangel\\nMen det er ikke bare Herbert Diess som klager over niv\u00e5et
  p\u00e5 service. Spesielt har mange elbilturister p\u00e5 ferie i Norge klaget over
  at det ikke er tak over ladestasjonene - heller ikke Ionitys.\\nS\u00e6rlig under
  en sommer som vi har hatt i \u00e5r, med hyppig forekomst av styrtregn, er det en
  lite hyggelig opplevelse \u00e5 st\u00e5 utenfor ved ladestolpen i striregnet og
  plundre med ladepistol og app eller RFID-brikke.\\n\u2013 Det er flere \u00e5rsaker
  til at vi ikke har installert tak, sier Jan Haugen Ihle, som er Ionitys regiondirekt\u00f8r
  for Nord-Vest-Europa, til Motor.\\n\u2013 For det f\u00f8rste har vi \u00f8nsket
  \u00e5 holde ladeprisene nede, og \u00e5 bygge tak over stasjonene ville medf\u00f8rt
  h\u00f8yere kostnader. Dessuten ville det tatt lengre tid om man skulle prosjektere
  inn tak, med hensyn ikke bare til selve byggingen, men ogs\u00e5 tiden det tar med
  byggemelding og lignende, sier han og fortsetter:\\n\u2013 N\u00e5r det gjelder
  sammenligningen med bensinstasjoner: Der st\u00e5r man jo med fyllepistolen i h\u00e5nden
  i flere minutter for \u00e5 f\u00e5 tanket. Ved ladestolpen er det nok \u00e5 koble
  til ladepistolen. \u00c5 sette i gang lading med appen kan gj\u00f8res inne i bilen
  dersom det skulle regne.\\nOm Ihle utelukker at det kan komme til \u00e5 bygges
  tak over ladestasjonene i fremtiden?\\n\u2013 Nei, vi utelukker det ikke, men det
  vil ikke komme overalt.\\n\u2013 Her har han nok for det f\u00f8rste v\u00e6rt litt
  uheldig, og kommet til en ladestasjon der servicen sviktet der og da. Vi har d\u00f8gn\u00e5pen
  kundeservice som kan hjelpe hvis kunden har behov for dette, telefonnummeret st\u00e5r
  p\u00e5 ladestolpen, sier Ihle.\\n\u2013 De fleste av Ionitys lokasjoner er p\u00e5
  steder der det ogs\u00e5 finnes servicestasjoner - ofte med d\u00f8gnservice og
