  bygget ut Tjuvholmen enn Vestbanen.\\nStrid om Vestbane-vinneren\\nBakgrunnen for
  Ulf Gr\u00f8nvolds utsagn, er en lang artikkel han skriver i Dagens N\u00e6ringsliv
  i dag. Vestbanetomten og Tjuvholmen, som ligger i forlengelsen av Aker Brygge, er
  Oslos to mest attraktive tomter. Staten eier Vestbanen, og Statsbygg kalte inn noen
  av verdens beste arkitekter til en lukket konkurranse.\\nVinnerne ble det nederlandske
  kontoret OMA. Dette forslaget har det siden har v\u00e6rt stor strid om, og s\u00e5
  og si ingen andre enn juryen har forsvart det. P\u00e5 Tjuvholmen blir det noe annet,
  mener Gr\u00f8nvold.\\nSelmer Skanskas forslag til musikkhus p\u00e5 Tjuvholmen.\\n-
  P\u00e5 Vestbanen hadde vi disse utenlandske stjernearkitektene, og s\u00e5 skulle
  resultatet selges videre til en utbygger. Det er en veldig svak modell. Men p\u00e5
  Tjuvholmen er det kapitalkreftene som g\u00e5r inn med en gang, og s\u00e5 har man
  med seg arkitekter. Det blir mer realtistiske, og vel s\u00e5 spennende, prosjekter
  med den modellen havnevesenet har valgt n\u00e5.\\nIkke redd publikum\\nHan legger
  ogs\u00e5 vekt p\u00e5 at man i Tjuvholmen-modellen ikke er redd for publikums reaksjoner.\\n-
  Jeg tror likevel at man vil velge ut fra faglige kriterier. Men man vil ikke f\u00e5
  alt dette grumset vi har f\u00e5tt p\u00e5 Vestbanen, sier Gr\u00f8nvold.\\nAv Birger
  Kolsrud J\u00e5sund\\nKulturnytt, NRK P2, onsdag 18. september 200\"", "\"Flygeblad
