  v\u00e6rt et kontroversielt tema i norske mediehus de siste \u00e5rene. Kritikerne
  frykter sammenblanding av sponset innhold og redaksjonelt stoff, vil svekke medienes
  troverdighet.\\nVGs sjefredakt\u00f8r og administrerende direkt\u00f8r, Torry Pedersen,
  innr\u00f8mmet at avisen hadde gjort en feil, og forklarte hvorfor han trakk videoen.\\n\u2013
  Fordi dette utvisker de forskjellene man m\u00e5 s\u00f8ke \u00e5 tilstrebe for
