  tar direkte kontakt med deg ang. leveringstiden, da dette kan variere.\"", "\"Hostal
  La Campana er et ypperlig valg for reisende som bes\u00f8ker La Linea de la Concepcion,
  for her finner du en mange kjekke fasiliteter som er utviklet for \u00e5 gj\u00f8re
  oppholdet ditt enda litt bedre.\\nHostal La Campana er et budsjettvennlig hotell
  som blant annet har klimaanlegg p\u00e5 rommene. Det er i tillegg enkelt \u00e5
  koble seg p\u00e5 internett med gratis wi-fi.\\nHer finnes ogs\u00e5 d\u00f8gn\u00e5pen
  resepsjon og bagasjeoppbevaring.\\nLa Linea de la Concepcion har plenty av italienske
  restauranter. S\u00e5 n\u00e5r du f\u00f8rst er her, b\u00f8r du passe p\u00e5 \u00e5
  sjekke ut popul\u00e6re steder slik som Restaurant Gallipoli, Pizza Napoli og Mil
  Pastas SL., som byr p\u00e5 gode matretter.\\nDet er nok av ting \u00e5 gj\u00f8re
  i dette omr\u00e5det. Du kan for eksempel utforske popul\u00e6re monumenter slik
  som Monument to the Spanish Workers in Gibraltar.\\nVi h\u00e5per du stortrives
  i La Linea de la Concepcion!\\nVi bodde en natt her for \u00e5 bes\u00f8ke Gibraltar,
  den gode ole-klippen. Dette var et budsjetthotell - definitivt ingen frills, rommet
  v\u00e5rt hadde null utsikt, pluss at konstruksjonen ble gjort p\u00e5 gaten da
  vi bes\u00f8kte (ikke hotellets skyld). N\u00e5r det er sagt, rommet v\u00e5rt var
  rent, hadde AC og de ansatte i resepsjonen var vennlige. I n\u00e6rheten av restauranter
  i La Linea og innen 10 minutters gangavstand til grensen. Oh, og det er en vaskeri
  ved siden av hotellet, og jeg tror de samme eierne, s\u00e5 det var et klart pluss
  (ikke n\u00f8dvendig \u00e5 ta med eget vaskemiddel heller, maskinen har det programmert!).\\nRommet
  rengj\u00f8res daglig, veldig rimelige priser for drinker te eller kaffe med toast
  kan kj\u00f8pes i resepsjonen, mange steder \u00e5 spise i omr\u00e5det, ikke langt
  for \u00e5 g\u00e5 inn i Gibraltar-grensen, men ikke glem passene dine. Nydelig
  ekte familiedrevet hostell.\\nHostell ligger en 5-minutters spasertur fra grensen
  til Gibraltar, ganske lett \u00e5 finne, med mange kafeer og billige spisesteder
  i nabolaget. Rommet var ganske enkelt m\u00f8blert (senger, stoler, air condition,
  en garderobe, flatskjerm-TV, ganske stort bad med gratis toalettsaker), men vi trengte
  ikke mye som vi bodde bare 3 dager. I tillegg ble rommet rengjort hver dag. Gutta
  i resepsjonen var hyggelige og vennlige og pr\u00f8vde \u00e5 kommunisere p\u00e5
  engelsk, men for noen av dem som syntes \u00e5 v\u00e6re litt vanskelig, men noen
  snakket ganske bra. Ingen m\u00e5ltid planer tilbys p\u00e5 rommene. Men det er
  ingen salgsautomater \u00e5 kj\u00f8pe en matbit, kaffe eller en boks med drikke.
  Flislagt gulv var litt kaldt. Men ellers - hvis jeg bes\u00f8ker La Linea ir Gibraltar
  igjen, vil dette hostalet v\u00e6re mitt valg nr. 1 .\\nPraktisk beliggenhet for
  \u00e5 f\u00e5 tilgang til Gibraltar. Med mange restaraunts innen gangavstand. Det
